function StudentList(props) {

  const {changeText} = props

  return (
    <div>
        <h4>StudentList</h4>
        {changeText ? (
          <p>The number in this class is 15</p>
          ) : null}
    </div>
  )
}


function StudentList2(){

  const List = ['Bola', 'Idrees', 'Tolani', 'Abdullah'];

  return (
    
      List && List.length > 0 ? 
      List.map((listItem, index) => {(
        <div>
          <ul key={`${listItem}-${index}`}>{listItem}</ul>
      </div>)
      })
       :
      <p>No List available</p>
  )
}
export default StudentList
